import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav style={{
      backgroundColor: '#333',
      padding: '1rem',
      display: 'flex',
      gap: '1rem'
    }}>
      <Link to="/clientes" style={{ color: 'white', textDecoration: 'none' }}>Clientes</Link>
      <Link to="/produtos" style={{ color: 'white', textDecoration: 'none' }}>Produtos</Link>
      <Link to="/vendas" style={{ color: 'white', textDecoration: 'none' }}>Vendas</Link>
    </nav>
  );
}

export default Navbar;
